;; **
;;; Modify the division operator to sidestep diving by zero.
;; **

;; @@
(defn pdiv [x y] (if (zero? y) 1 (/ x y)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-darwin/pdiv</span>","value":"#'joel-spea2-darwin/pdiv"}
;; <=

;; **
;;; List fucntions (as maps) and define thier arity (arguements taken). Simplified to the fact that each operatory has a fixed arity.
;; **

;; @@
(def dwin-functions
  [{:name '+ :arity 2}
   {:name '- :arity 2}
   {:name '* :arity 2}
   {:name 'pdiv :arity 2}])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-darwin/dwin-functions</span>","value":"#'joel-spea2-darwin/dwin-functions"}
